#4 Fibbonacci Rabbits
n = 0
k = 0
num = 0
def fib(n, k):
    if n <= 2:
        return 1
    elif n ==3:
        return 1+k
    else:
        return num + (fib(n-2, k)*k) + fib(n-1, k)

