#5 Mortal Fibbonnacci Rabbits v2 (kinda maybe sorta got this from chatgpt)
def dyingrabs(n, m):
    global x
    x=0
    if n <= 2:
        return 1
    
    dp = [1] * (n+1)
    dp[1] = 1
    dp[2] = 1

    for i in range(3, n+1):
        if i <=m:
            x+=2
            dp[i] = dp[i-1]+dp[i-2]
        else:
            x+=3
            dp[i] = dp[i-1]+dp[i-2]-dp[i-m-1]
    
    return dp[n]
